package com.dp.ggomjirak.vo;

public class CompleteImgVo {
	private int hobby_no;
	private String img_name;
	private int num;
	private int seq;
	

	public CompleteImgVo() {
		super();
		// TODO Auto-generated constructor stub
	}


	public int getHobby_no() {
		return hobby_no;
	}


	public void setHobby_no(int hobby_no) {
		this.hobby_no = hobby_no;
	}


	public String getImg_name() {
		return img_name;
	}


	public void setImg_name(String img_name) {
		this.img_name = img_name;
	}


	public int getSeq() {
		return seq;
	}


	public void setSeq(int seq) {
		this.seq = seq;
	}


	public int getNum() {
		return num;
	}


	public void setNum(int num) {
		this.num = num;
	}


	@Override
	public String toString() {
		return "CompleteImgVo [hobby_no=" + hobby_no + ", img_name=" + img_name + ", num=" + num + ", seq=" + seq + "]";
	}





	
	
 
}
